import "./imageLinkForm.css";

const ImageLinkForm = () => {
	return (
			  <div>
				  <p className='f3 white tc'>
				  	{'Face Detection'}
				  </p>
				  
			  	  <div className='center'>
			  	  	<div className='pa40 br3 shadow-5 center'>
					  <input className='f4 pa2 w-70 center' type='text' id='fname' name='fname' />
					  <button className='w-30 grow f4 link ph3 pv2 dib white bg-light-purple' type='submit' value='Submit'>Detect</button>
			      	</div>
			      </div>
			  </div>

	)
}

export default ImageLinkForm;
